import React, { Component } from 'react';

class List extends Component{
    constructor(props){
        super(props);
        this.state = {
            list : [
             { a_projectid: '',
              a_depth : '',
              a_metername: '',
              a_meterdesc : '',
              a_meterreading: '',
              a_readdate: ''

            }
            ]
        }
    }

    componentDidMount(){
        this.getList();
    }

    getList = () => {
        fetch('localhost:4006')
        .then(res =>res.json())
        .then(list => this.setState({list}))

    }

    render(){

        const {list} = this.state;

        return (
            <div className="App">
              <h1>List of Items</h1>
              {list.length ? (
                <div>
                  {list.map((item) => {
                    return(
                      <div>
                       <p> {item.a_projectid} {item.a_depth} {item.a_metername}</p>
                      </div>
                    );
                  })}
                </div>
              ) : (
                <div>
                  <h2>No List Items Found</h2>
                </div>
              )
            }
            </div>
          );

        }
            
}

export default List;
